import "./CostItem.css";

function CostItem({ item }) {
  [name, price, date ] = item;

  return (
    <div class="container">
      <div class="row">
        <div class="product-name">{item.name}</div>
        <div class="price-name">{item.price}$</div>
      </div>
      <div class="date-name">{item.date.toLocaleDateString()}</div>
    </div>
  );
}

export default CostItem;
